import { useState } from "react";
import { Navbar, Footer, Login } from "./components";
const App = () => {
  const [token,setToken] = useState();
    if(!token) {
    return <App setToken={setToken} />
  }

  return (
    <div className="min-h-screen">
      <div className="bg-gradient-bg-welcome">
        <Navbar />
        <Login />
        <Footer />
      </div>
    </div>
  );
}

export default App;
